        //汉字转换为拼音首字母
        public static string GetPinYin(string strText)
        {
            if (string.IsNullOrEmpty(strText))
            {
                return strText;
            }
            if (strText.Length == 0)
            {
                return strText;
            }
            var myStr = new StringBuilder();
            foreach (var vChar in strText)
            {
                if ((vChar >= 'a' && vChar <= 'z') || (vChar >= 'A' && vChar <= 'Z'))
                    myStr.Append(char.ToUpper(vChar));
                else if (vChar >= 19968 && vChar <= 40869)
                {
                    myStr.Append(StrChineseFirstPy[vChar - 19968]);
                }
                else
                {
                    myStr.Append(vChar);
                }
            }
            return myStr.ToString();
        }
    }
